import React from 'react';

const LocationButton = ({ onClick }) => (
  <div
    style={{
      position: 'absolute',
      top: 10,
      left: 10,
      zIndex: 1000,
      background: 'white',
      padding: '10px',
      borderRadius: '5px',
      boxShadow: '0 2px 6px rgba(0,0,0,0.3)',
    }}
  >
    <button onClick={onClick}>도보 10분 거리 시설 찾기</button>
  </div>
);

export default LocationButton;
